ive_fail="Etkinleştirme başarısız oldu";mcs_active_success="Başarıyla aktif";mcs_renew_success="Yenileme başarılı";mcs_renew_fail="Yenileme başarısız oldu";mcs_active_code_empty="Aktivasyon kodu boş olamaz";mcs_vbox_about="üzerinde";mcs_clean_data="Verileri temizle";mcs_clean_data_tip="Bulut depolama verilerini temizle";mcs_vbox_id="Bulut Depolama Kimliği";mcs_bind_device="Ilgili ekipman";mcs_vbox_invalid_date="Bulut depolama son kullanma tarihi";mcs_upload_info="Bilgileri yükle";mcs_can_choose_vbox_use="Bir bulut depolama hizmeti satın aldınız ve bazı bulut depolama alanı ücretsizdir, kullanıma geçebilirsiniz.";mcs_change_vbox="şalter";mcs_change_vbox_success="Başarılı aktarım";mcs_change_vbox_fail="Aktarım başarısız";mcs_vbox_instruction="Kısa Tanıtım";mcs_vbox_instruction_text="Bulut depolama işlevi, kamera tarafından hareketli nesne algılama gibi teknolojilere dayanan bir video depolama işlevidir. Fotoğraf makinesi, yürüyen bir kişi veya hareket eden bir öğe gibi hareketli bir olay algıladığında, kamera otomatik olarak videoyu kaydedecek ve yüksek şifreleme ile buluta yükleyecektir.Aynı zamanda, insan yapımı imha ve SD kart imhasından kaynaklanan önemli veri kaybını etkin bir şekilde önleyecektir.";mcs_vbox_instruction_buy="Bulut depolama alanı nasıl alınır?";mcs_vbox_instruction_buy_text="Cihaz - [Ayarlar] - [Bulut Depolama] - [Bulut Depolama'yı Etkinleştir] - Satın almak için [Bulut depolama alanı satın al] 'ı seçin.";mcs_vbox_buy_tip_title="İpuçları:";mcs_vbox_buy_tip_text1="1) bulut depolama hizmeti başarılı satın aldıktan sonra iade desteklemiyor, para iadesi desteklemiyor";mcs_vbox_buy_tip_text2="2) Bulut depolama alanı sadece satın alan kullanıcıya bağlı olup, bulut depolama servisine sahip cihaz silinir ve yeni bir hesap eklenir.Yeni hesap altında cihaz bulut depolama hizmetinden yararlanmaya devam edemez.";mcs_how_calculate_service_time="Bulut depolama alanı satın alındıktan sonra servis süresi hesaplaması";mcs_calculate_describe="Satın alma işleminiz başarılı ve aktif olduğunda, bulut depolama alanı kullanılabilir ve etkinleştirme günü hizmet saatini hesaplamaya başlarız. Örneğin, 13 Nisan 2017 tarihinde 7 gün boyunca bir bulut depolama hizmeti satın aldıysanız ve etkinleştirme tarihi 14 Nisan 2017 ise, hizmet sonlandırma süresi 14 Mayıs 2017'dir ve depolama alanı 14 Nisan 2017'de başlamaktadır. 20 Nisan 2017’den itibaren. 21 Nisan 2017'de, 14 Nisan 2017'nin bulut depolama videosu otomatik olarak silinecek ve bulut depolama verileri 15 Nisan 2017'den 21 Nisan 2017'ye kadar korunacak ve günlük veriler gelecekte tek tek silinecek.";mcs_vbox_instruction_renew="Bulut depolama alanının yenilenmesi";mcs_vbox_instruction_renew_text1="1) Satın aldığınız bulut depolama alanının süresi dolduysa, diğer paket hizmet türlerini yenileyebilir veya satın alabilirsiniz. Satın alma aktivasyonundan sonra, yeni bulut depolama paketi hemen yürürlüğe girecektir.";mcs_vbox_instruction_renew_text2="2) Satın aldığınız bulut depolama hizmetinin süresi dolmamışsa, aynı paket servisini satın alın (aynı türde video saklama süresi) ve yeni servis, servis süresini orijinal hizmet saatinde uzatır.";mcs_vbox_instruction_renew_text3="3) Satın aldığınız bulut depolama hizmetinin süresi dolmamışsa ve yeni paket hizmetini değiştirmek istiyorsanız, farklı paket değiştirme hizmetleri desteklenmez Yeni bir bulut depolama hizmeti satın almadan önce bulut depolama alanını çözmeniz gerekir. Depolama normalde kullanılabilir.";mcs_vbox_instruction_reset="Kamera fabrika sıfırlama";mcs_vbox_instruction_reset_text="Kamera RESET tuşuna 10 saniye basıp fabrika ayarlarını geri yüklediğinde, kamera ve bulut depolama birimi bağlantısı kesilir, geçmiş verileri geri yüklemek için bulut depolama alanını etkinleştirmeniz gerekir.";mcs_vbox_unbind="Bulut depolama";mcs_vbox_unbind_text1="1) Bulut depolama ve kamera çözüldükten sonra, kameranın videosu artık kaydedilmez ve saklanan video, hizmet süresi sona erdikten sonra otomatik olarak silinir.";mcs_vbox_unbind_text2="2) Ayrıştırma işleminden sonra, bulut depolama diğer kameralara bağlanabilir. Diğer kameraları bağladıktan sonra, daha önce kaydedilmiş olan video bir sonraki döngü kaydı sırasında silinecektir.Yatıştırma bulut depolama hizmeti 7 gün boyunca satın aldıysanız, bulut depolama kamera A'ya bağlanır ve kamera A'dan önce kamera B'ye bağlanır. Kaydedilen yedi günlük video, döngü kaydının sekizinci gününde otomatik olarak silinecektir. Bulut depolama hizmeti türü ve son kullanma süresi değişmez.";mcs_vbox_choose="Bulut depolama alanını seç";mcs_vbox_choose_text1="Cihaz Seç - [Ayarlar] - [Bulut Depolama] - [Bulut Depolama'yı Etkinleştir] - [Seçmek için Bulut Depolama Alanı]";mcs_vbox_choose_text2="Cihazı satın aldığınızda ve aynı zamanda bulut depolama alanını satın aldığınızda, aygıt bir sebepten ötürü iade edildi (Not: Bulut depolama hizmeti satın alındıktan sonra geri dönüşü desteklemez, geri ödeme desteklenmez) Aygıtı ve bulut depolama alanını çözebilirsiniz. Bulut Depolama, yeni cihazınıza bağlı.";mcs_vbox_choose_tip_text1="1) Bulut depolama ve hesap bağlama için, sadece aynı hesap kullanılabilir: Çözülmemiş bulut depolama aygıtı ve bağlı bulut depolama aygıtı aynı hesap altında olmalıdır.";mcs_vbox_choose_tip_text2="2) Bulut depolama seçenekleri yalnızca ücretsiz bulut depolama alanınız varsa kullanılabilir.";mcs_input_pwd="Lütfen şifrenizi giriniz";mcs_bind_fail="Cihaz bağlantısı başarısız oldu";mcs_pwd_empty="Şifre boş olamaz";mcs_set_pwd_success="Şifre başarısını ayarla";mcs_set_pwd_fail="Şifre ayarlanamadı";mcs_open_upload_yet="Yüklendi";mcs_open_upload_fail="Yükleme açılamadı";mcs_close_upload_yet="Kapalı yükleme";mcs_close_upload_fail="Yükleme başarısız oldu";mcs_get_info_fail="Bilgi alınamadı";mcs_set="kurmak";mcs_vbox_active="etkinleştirme";mcs_unbinding="Biz ayrıştırma vardır ...";mcs_activating="Aktivasyon ...";mcs_sending="Biz talebinde ...";mcs_changing="Anahtarlama";mcs_unbind_yet="Cihazınızı henüz bağlamadınız";mcs_nopermission_unbind="Çözme izni yok";mcs_